import styled from "styled-components"


export const Container = styled.div` 
    max-width: 1200px;
    margin: 50px auto;
`;

export const Content = styled.div`
    display: grid;
    h1{
        margin-bottom: 50px;
    }
`;

export const Project = styled.div`
    display: grid;

    img{
        border-radius: 10%;
        width: 200px;
        height: auto;
    }

    h4{
        position: relative;
        background-color: aliceblue;
    }


`;
